export const loginStart = ()=>({
    type:"LOGIN_START"
})

export const loginSuccess=(user)=>({
    type:"LOGIN_SUCCESS",
    payload:user
})

export const loginFailure=()=>({
    type:"LOIN_FAILURE"
})

//LOGOUT
export const logout=()=>({
    type:"LOGOUT"
})
